import React, { Component } from "react";

class SizeFilters extends Component {
  render() {
    return (
      <div className="size-filters-container">
        <div>
          <div className="size-filter-row1">
            <input type="button" className="size-filter" value="XS" />
            <input type="button" className="size-filter" value="S" />
            <input type="button" className="size-filter" value="M" />
            <input type="button" className="size-filter" value="ML" />
          </div>
          <div>
            <input type="button" className="size-filter" value="L" />
            <input type="button" className="size-filter" value="XL" />
            <input type="button" className="size-filter" value="XXL" />
          </div>
        </div>
      </div>
    );
  }
}

export default SizeFilters;
